%[text] %[text:anchor:T_290322D3] # Create Building Model Part From BIM Import
%[text] Copyright 2025 - 2026 The MathWorks, Inc.
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] %[text:anchor:H_A472BDDC] ## Import BIM Data
%[text] %[text:anchor:H_5C97DF97] ### ![BIMdataImportMATLAB.png](text:image:89ac)
%[text] There are multiple 3D modeling CAD packages you can use to make a Building Information Model (BIM). This example uses the Autodesk Revit tool to generate the BIM, which you can export to a standard IFC format that stores data in an XML format. Import the XML data to Simscape with the utility function, `getBuildingDataFromBIM`, and create the Simscape building using `createBuildingModelFromBIM`.
%[text] There are 4 pre-generated building models in this project for this example. All the data is saved as XML files, along with their 3D snapshots, in the `Workflow/ImportBIMforHeatLoadAnalysis` folder.
%[text] The `getBuildingDataFromBIM` extracts only the geometry and material property data from the BIM model, which is the only data needed to create a Simscape Building. The solar load data based on the building location is automatically calculated within Simscape building component.
%[text] ## Read Data
%[text] Read BIM data for a building that has two rooms: one a T-shaped room and the other a rectangular room.
[modelData,dataBIM] = getBuildingDataFromBIM(... %[output:group:3fb31900] %[output:800ee7d5] %[output:3f7b397c] %[output:7ffb98f0] %[output:7f83894a] %[output:15968b91]
                        FileName="importBuildingTshapedRoom.xml",... %[output:800ee7d5] %[output:3f7b397c] %[output:7ffb98f0] %[output:7f83894a] %[output:15968b91]
                        Debug=false,RoundOff=5); %[output:group:3fb31900] %[output:800ee7d5] %[output:3f7b397c] %[output:7ffb98f0] %[output:7f83894a] %[output:15968b91]
%[text] The output of the `getBuildingDataFromBIM` function displays some room connectivity information in a table, which specifies the room to room connectivity information. In Simscape, all rooms are specified as rectangular. Non-rectangular rooms are made from a combination of multiple rectangular rooms, with connecting walls removed of modified. For example, in a T-shaped room, the room is represented by two rectangular rooms, both named with similar indices (room2a and room2b, in this case). The table shows that the connecting wall between these two rooms is missing, because the **Solid Wall Fraction** parameter is zero. The function automatically sets this data, and displays the table for information and data verification. You can also set the *Debug* argument in `getBuildingDataFromBIM` to *true* to read more diagnostics on the BIM data import process. 
%[text] ## Create Building Model
%[text] Compute the data required to create building model in Simscape and save it in a data struct called `building`.
[building,modelData] = createBuildingModelFromBIM(... %[output:group:83f0e404] %[output:388dc744] %[output:7a3e2ceb] %[output:6d70acd8] %[output:8c9dd87c] %[output:8cce2c9a] %[output:3095b2f3] %[output:71d8770b]
                        DataBIM=dataBIM,... %[output:388dc744] %[output:7a3e2ceb] %[output:6d70acd8] %[output:8c9dd87c] %[output:8cce2c9a] %[output:3095b2f3] %[output:71d8770b]
                        DataBuilding=modelData,... %[output:388dc744] %[output:7a3e2ceb] %[output:6d70acd8] %[output:8c9dd87c] %[output:8cce2c9a] %[output:3095b2f3] %[output:71d8770b]
                        Debug=true,... %[output:388dc744] %[output:7a3e2ceb] %[output:6d70acd8] %[output:8c9dd87c] %[output:8cce2c9a] %[output:3095b2f3] %[output:71d8770b]
                        Tol=0.00001,... %[output:388dc744] %[output:7a3e2ceb] %[output:6d70acd8] %[output:8c9dd87c] %[output:8cce2c9a] %[output:3095b2f3] %[output:71d8770b]
                        BuildingName="MyBuilding"); %[output:group:83f0e404] %[output:388dc744] %[output:7a3e2ceb] %[output:6d70acd8] %[output:8c9dd87c] %[output:8cce2c9a] %[output:3095b2f3] %[output:71d8770b]
%%
%[text] ## Visualize Building Model
%[text] Visualize the Simscape `building` model. You can compare the visualization to the 3D snapshot above to confirm the model generation. In the Simscape building model, all walls and doors on a given wall are specified as a single opening. You may observe multiple windows on a given wall in the 3D representation, but would observe only a single opening in the Simscape representation. 
viewingAngle = [-1 -1 1]; 

figure("Name","BuildingUnit Elevation"); %[output:2a3faf98]
plot3DlayoutBuilding(Building=building,... %[output:group:4942da90] %[output:2a3faf98]
                        PlotViewDirection=viewingAngle,... %[output:2a3faf98]
                        ColorScheme="simple",... %[output:2a3faf98]
                        InternalWalls=true,... %[output:2a3faf98]
                        DebugMode=true); %[output:group:4942da90] %[output:2a3faf98]
%[text] ## Save Part Data
%[text] Save the building data in an XML file. You can load this part file later and use it for analysis. All this data is saved in folder `ScriptsData/Parts`.
writeBuildingDataXML(Building=building,FileName="BuildingModelPartFromBIMimport.xml"); %[output:926889c6]
%[text] 

